import React, { Component } from "react";
import { TextField, Grid, Card, CardContent } from "@material-ui/core";

export class Login extends Component {
  render() {
    return (
      <div>
        <Grid
          className="mt-2"
          container
          spacing={3}
          justify="center"
          alignItems="center"
        >
          <Grid item xs={6}>
            <Card className="mt-2">
              <CardContent>
                <TextField
                  id="outlined-full-width"
                  label="Email"
                  style={{ marginTop: 4, padding: 12 }}
                  placeholder="Email Address"
                  fullWidth
                  margin="normal"
                  InputLabelProps={{
                    shrink: true,
                  }}
                  variant="outlined"
                />

                <TextField
                  id="outlined-full-width"
                  label="Password"
                  style={{ marginTop: 4, padding: 12 }}
                  placeholder="Password"
                  fullWidth
                  margin="normal"
                  InputLabelProps={{
                    shrink: true,
                  }}
                  variant="outlined"
                />
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default Login;
